import React from 'react';

function Header() {
  return (
    <header>
      
      <div className="header-section">
        <div className="logo">Logo</div>
        <div className="location">Ubicación</div>
        <div className="search">Búsqueda</div>
        <div className="login">Login</div>
      </div>

    
      <div className="header-section">
        <div className="menu-icon">Menú hamburguesa</div>
        <div className="categories">Categorías</div>
        <div className="notifications">Notificaciones</div>
        <div className="orders">Pedidos</div>
        <div className="cart">Carrito</div>
      </div>
    </header>
  );
}

export default Header;
